import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { addToCart } from '../../redux/actions';
import './item.css';

const Item = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const dispatch = useDispatch();
  const [item, setItem] = useState(null);
  const [count, setCount] = useState(1); // Стейт для Countable field
  const [selectedOption, setSelectedOption] = useState(''); // Стейт для Selectable field

  useEffect(() => {
    const fetchItem = async () => {
      try {
        const response = await fetch(`http://localhost:3000/api/products/${id}`);
        if (!response.ok) {
          throw new Error('Product not found');
        }
        const data = await response.json();
        setItem(data);
      } catch (error) {
        console.error('Error fetching product data:', error);
      }
    };

    fetchItem();
  }, [id]);

  if (!item) return <div>Loading...</div>;

  const handleAddToCart = () => {
    const product = {
      id: item.id,
      name: item.name,
      price: item.price,
      image: item.image,
      quantity: count, // Використовуємо кількість з Countable field
      selectedOption, // Використовуємо вибрану опцію з Selectable field
    };
    dispatch(addToCart(product)); // Додаємо товар до кошика
    navigate('/cart'); // Перехід до кошика
  };

  // Обробники для змін в полях
  const handleCountChange = (e) => {
    setCount(e.target.value);
  };

  const handleSelectChange = (e) => {
    setSelectedOption(e.target.value);
  };

  return (
    <div className="item-page">
      <div className="item-image">
        <img src={item.image} alt={item.name} />
      </div>
      <div className="item-details">
        <h1 className="item-title">{item.name}</h1>
        <p className="item-description">{item.description}</p>
        <p className="item-price">Price: ${item.price}</p>
        <div className="item-actions">
          <div className="field-group">
            <label htmlFor="countable-field" className="field-label">Countable field</label>
            <input
              type="number"
              min="1"
              value={count} // Прив'язуємо до state
              onChange={handleCountChange} // Обробник зміни
              id="countable-field"
              className="countable-field"
            />
          </div>
          <div className="field-group">
            <label htmlFor="selectable-field" className="field-label">Selectable Field</label>
            <select
              id="selectable-field"
              className="selectable-field"
              value={selectedOption} // Прив'язуємо до state
              onChange={handleSelectChange} // Обробник зміни
            >
              <option value="">Select</option>
              <option value="Size M">Size M</option>
              <option value="Size L">Size L</option>
              <option value="Color Black">Color Black</option>
              <option value="Color Red">Color Red</option>
            </select>
          </div>
        </div>
        <div className="item-buttons">
          <button className="back-button" onClick={() => navigate(-1)}>Go back</button>
          <button className="add-button" onClick={handleAddToCart}>Add to cart</button>
        </div>
      </div>
    </div>
  );
};

export default Item;
